import React from 'react'
import './Project.css'

import audit from './AuditAnalytics.png'
import geviz from './Geviz3.png'
import ML from './FraudML.png'

// import profilepic from './profilePic.jpg'
// import Timeline from './Timeline'
const Project = () => {
  const ProjectItems = [
    {
      projectName: 'Visualize Singapore Government Spending',
      imageName: geviz,
      url: 'Geviz.html',
    },
    {
      projectName: 'Detecting Financial Statement Fraud with ML',
      imageName: audit,
      url:
        'https://towardsdatascience.com/detecting-firms-with-intentional-misstatements-using-machine-learning-a943191f88cf',
    },
    {
      projectName: 'Procurement Fraud Tableau Dashbord',
      imageName: ML,
      url: 'AuditAnalytics.html',
    },
  ]

  return (
    <div class="project-row" id="project-section">
      <div class="project-intro">
        <h1 class="white-text">My Projects</h1>
        <p class="white-text">A glimpse of the my past projects</p>
      </div>
      {ProjectItems.map((item, index) => {
        return (
          <>
            <a class="img-container" href={item.url}>
              <img
                class="home-project-image"
                src={item.imageName}
                alt="project pic"
              />
              <h3 class="text middle">{item.projectName}</h3>
            </a>
          </>
        )
      })}
    </div>
  )
}

export default Project
